import numpy as np

import parameters as pm 

def bootstrap(data,err,nboot):
    boots=[]
    for ii in range(nboot):
        buf=[]
        for ti in range(len(data)):
            buf.append(np.random.normal(data[ti],err[ti]))
        boots.append(buf)
    return np.array(boots)

def dot(p,q):
    return p[0]*q[0]-np.dot(p[1:],q[1:])

def length(p):
    return np.sqrt(np.dot(p[1:],p[1:]))

def fdip(Qs,lam):
    return 1.0/(1+Qs/lam**2)

def fpi(t,lam):
    Fpi=lam[0]
    g1=lam[1]
    return Fpi+(t-pm.mpi**2)*g1

def dsLdt(s,t,qs,lam):
    norm=pm.gev2mb*pm.alpha/4.0/((s-pm.mn**2)*np.sqrt(kallen(s,qs,pm.mn**2)))
    amps=amp(s,t,qs,0,0,lam)
    return norm*np.real(amps)

def dsTdt(s,t,qs,lam):
    norm=pm.gev2mb*pm.alpha/4.0/((s-pm.mn**2)*np.sqrt(kallen(s,qs,pm.mn**2)))
    amps=(amp(s,t,qs,-1,-1,lam)+amp(s,t,qs,1,1,lam))/2.0
    return norm*np.real(amps)

def dsTTdt(s,t,qs,lam):
    norm=pm.gev2mb*pm.alpha/4.0/((s-pm.mn**2)*np.sqrt(kallen(s,qs,pm.mn**2)))
    amps=-(amp(s,t,qs,-1,1,lam)+amp(s,t,qs,1,-1,lam))/2.0
    return norm*np.real(amps)

def dsLTdt(s,t,qs,lam):
    norm=pm.gev2mb*pm.alpha/4.0/((s-pm.mn**2)*np.sqrt(kallen(s,qs,pm.mn**2)))
    amps=-(-amp(s,t,qs,0,-1,lam)-amp(s,t,qs,-1,0,lam)+amp(s,t,qs,0,1,lam)+amp(s,t,qs,1,0,lam))/(2.0*np.sqrt(2.0))
    return norm*np.real(amps)


def get_eps(q,lam):
    if lam==0:
        eps=np.array([length(q),0,0,q[0]])/np.sqrt(-dot(q,q))
    elif lam==1 or lam==-1:
        eps=-lam/np.sqrt(2.0)*np.array([0,1,lam*1j,0])
    return eps
        
def kallen(a,c,b):
    return a**2+b**2+c**2-2*(a*b+a*c+b*c)
        
def get_fv(s,t,qs):
    E1=(s-qs+pm.mn**2)/(2*np.sqrt(s))
    Eq=(s+qs-pm.mn**2)/(2*np.sqrt(s))
    E2=(s-pm.mpi**2+pm.mn**2)/(2*np.sqrt(s))
    Ek=(s+pm.mpi**2-pm.mn**2)/(2*np.sqrt(s))

    p1len=np.sqrt(kallen(s,qs,pm.mn**2))/(2*np.sqrt(s))
    qlen=np.sqrt(kallen(s,qs,pm.mn**2))/(2*np.sqrt(s))
    p2len=np.sqrt(kallen(s,pm.mpi**2,pm.mn**2))/(2*np.sqrt(s))
    klen=np.sqrt(kallen(s,pm.mpi**2,pm.mn**2))/(2*np.sqrt(s))

    costheta=(t-2*pm.mn**2+2*E1*E2)/(2.0*p1len*p2len)
    sintheta=np.sin(np.arccos(costheta))
    
    p1=np.append(E1,p1len*np.array([0,0,-1]))
    q=np.append(Eq,qlen*np.array([0,0,1]))
    p2=np.append(E2,p2len*np.array([-sintheta,0,-costheta]))
    k=np.append(Ek,klen*np.array([sintheta,0,costheta]))
    return p1,q,p2,k

def kGep(qs):
    a1=-0.24
    b1=10.98
    b2=12.82
    b3=21.97
    mN=pm.mn
    Qs=-qs
    tau=Qs/(4*mN**2)
    ans=(1+a1*tau)/(1+b1*tau+b2*tau**2+b3*tau**3)
    return ans

def kGmp(qs):
    a1=0.12
    b1=10.97
    b2=18.86
    b3=6.55
    mup=2.7928473446
    mN=pm.mn
    Qs=-qs
    tau=Qs/(4*mN**2)
    ans=mup*(1+a1*tau)/(1+b1*tau+b2*tau**2+b3*tau**3)
    return ans

def kF1p(qs):
    mN=pm.mn
    Qs=-qs
    tau=Qs/(4*mN**2)
    ans=(kGep(qs)+tau*kGmp(qs))/(1+tau)
    return ans
    
